import React, { useEffect, useState } from "react";

const questionsData = {
  students: {
    question_choice: {
      type: "yesNo",
      questions: [
        "Нуждаетесь ли вы в дополнительных мероприятиях в колледже?",
        "Удовлетворены ли вы скоростью решения вопросов администрацией колледжа?",
      ],
    },
    question_answer: [
      "Какие дополнительные мероприятия необходимо организовать?",
      "Укажите проблемные зоны в официальном сайте колледжа",
      "Укажите проблемные зоны в ведение социальных сетей и чатов",
      "Укажите проблемные зоны в работе буфета и колледжа",
    ],
  },
  teachers: {
    question_choice: {
      type: "yesNo",
      questions: [
        "Всегда ли доступна Вам вся необходимая информация, касающаяся учебного процесса?",
        "Нуждаетесь ли Вы лично в повышении квалификации?",
      ],
    },
    question_answer: ["Укажите проблемные зоны в аудиториях", "Укажите проблемы учебного процесса"],
  },
  parents: {
    question_choice: {
      type: "yesNo",
      questions: [
        "Комфортно ли ощущает Ваш ребенок себя в колледже?",
        "Всегда ли при необходимости Вы можете обратиться в колледж за советом?",
      ],
    },
    question_answer: ["Укажите проблемные зоны в спортивном зале", "Укажите проблемы родительских собраний"],
  },
};

const SurveyForm = () => {
  const [token, setToken] = useState(null);
  const [group, setGroup] = useState(null);
  const [unitId, setUnitId] = useState(null); // assuming unit_id is a number
  const [answers, setAnswers] = useState({});

  useEffect(() => {
    const url = window.location.href;
    const tokenMatch = url.match(/\/([a-f0-9]{32})$/);
    if (tokenMatch) {
      const extractedToken = tokenMatch[1];
      setToken(extractedToken);

      fetch(`http://192.168.88.123:8000/forms/${extractedToken}`)
        .then((res) => res.json())
        .then((data) => {
          setGroup(data.group);
          setUnitId(data.unit_id);
          setAnswers(
            questionsData[data.group]
              ? {
                  unit_id: data.unit_id,
                  group: data.group,
                  ...questionsData[data.group].question_answer.reduce((acc, q) => {
                    acc[q] = null;
                    return acc;
                  }, {}),
                  ...questionsData[data.group].question_choice.questions.reduce((acc, q) => {
                    acc[q] = 0;
                    return acc;
                  }, {}),
                }
              : {}
          );
        });
    }
  }, []);

  const handleYesNoChange = (question, value) => {
    setAnswers((prev) => ({ ...prev, [question]: value }));
  };

  const handleTextChange = (question, value) => {
    setAnswers((prev) => ({ ...prev, [question]: value }));
  };

  const handleCheckboxToggle = (question) => {
    setAnswers((prev) => ({
      ...prev,
      [question]: prev[question] === null ? "" : null,
    }));
  };

  const handleSubmit = () => {
    fetch("http://192.168.88.123:8000/docs/", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify(answers),
    });
  };

  console.log()

  if (!group) return <p>Загрузка...</p>;

  return (
    <div>
      <h1>Анкета для {group}</h1>
      <h2>Вопросы с выбором</h2>
      {questionsData[group]?.question_choice.questions.map((q, idx) => (
        <div key={idx}>
          <p>{q}</p>
          <button onClick={() => handleYesNoChange(q, 1)}>Да</button>
          <button onClick={() => handleYesNoChange(q, 0)}>Нет</button>
        </div>
      ))}
      <h2>Расширенные вопросы</h2>
      {questionsData[group]?.question_answer.map((q, idx) => (
        <div key={idx}>
          <p>{q}</p>
          <button onClick={() => handleCheckboxToggle(q)}>
            {answers[q] === null ? "Убрать" : "Меня все устраивает"}
          </button>
          <input
            type="text"
            value={answers[q] === null ? "" : answers[q]}
            onChange={(e) => handleTextChange(q, e.target.value)}
            disabled={answers[q] === null}
          />
        </div>
      ))}

      <button onClick={handleSubmit}>Отправить</button>
    </div>
  );
};

export default SurveyForm;
